import React from 'react';

function Navbar() {
    return(

        <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <div class="container">
            <a class="navbar-brand my-2 text-success h1" href="#">UnclePon</a>
            </div>
        </nav>

    );
}

export default Navbar;
